import React, { useState } from 'react';
import { useEffect } from 'react';

const Loans = ({ setAuth }) => {
  const [loans, setLoans] = useState([]);

  const GetLoans = async () => {
    try {
      const response = await fetch('http://localhost:8000/allLoans/', {
        method: 'GET',
        headers: { Authorization: localStorage.getItem('token') },
      });

      const parseRes = await response.json();

      setLoans(parseRes);
      // console.log(parseRes);
    } catch (error) {
      console.log(error.message);
    }
  };

  useEffect(() => {
    GetLoans();
  }, []);

  return (
    <div className='text-gray-900 bg-gray-200 flex'>
      {/* Loans Information */}
      <div className='w-full mx-auto px-8 pt-6 pb-8 mb-4 bg-white shadow-md rounded '>
        <div className='px-4 py-5 sm:px-6 bg-red-500'>
          <h3 className='text-lg font-medium leading-6 text-white'>
            Loan Information
          </h3>
          <p className='mt-1 max-w-2xl text-sm text-white'>
            Loan transactions and payments.
          </p>
        </div>

        {/* Active Loans */}
      </div>
    </div>
  );
};

export default Loans;
